@whitmark , your model has 97 individual named inputs, each of which have a name, a type (all are float32) and a shape (all are [1,1]). Hence, you need to create 97 DenseTensor objects, with a shape of [1,1], containing a float value for that input.

The 97 DenseTensors are then appended to the list/container as an input to the Run() method.

I tweaked your example slightly to get it running below. The values are probably not aligned with the exact named input, since the table schema is missing, but it conveys the point.

Feel free to close this issue if this works for you (or add more comments).

```C#
        static void Main(string[] args)
        {
            SessionOptions options = new SessionOptions();
            options.SetSessionGraphOptimizationLevel(1);

            using (var session = new InferenceSession(@"d:\models\whitmark\UpFPPModel\UpFPPModel.onnx", options))
            {
                var inputMeta = session.InputMetadata;
                var container = new List<NamedOnnxValue>();

                float[] inputData = new float[97] { 0.0f,  // Dummy Label Column ?
                                        18.0000f, 25.0000f, 37.2539f, 38.0000f, 69.0000f, 308.5923f, 24.0000f, 25.0000f, 119.3144f, 25.0000f,
